import './Item.css'
const Item = ({title,text}) => {
    return ( 
            <div className="container" style={
              {backgroundImage:`url(${backgroundimg})`}}
            >
                <div className="title">
                    <p>{title}</p>
                </div>
                <div className="description">
                    <p>{text}</p>
                </div>
            </div>
     );
}
 
export default Item;
